import React, { useState } from 'react';
import './Loginpage.css'; 
import axios from 'axios';

export const Loginpage = () => {
    const [message,setMessage]=useState('')
    const [visible, setVisible] = useState(true);
    const [formData, setFormData] = useState({
        emailid: '',
        password: ''
    });
    const [formData1, setFormData1] = useState({
        fullname: '',
        email: '',
        mobno:'',
        password: '',
       
    });

    const handleChange = (event) => {
        const { name, value } = event.target;
        setFormData({
            ...formData,
            [name]: value
        });
    };
   const handleSubmit1=async (event)=>{
         event.preventDefault();
         try {
            const response =await axios.post('http://localhost:9093/Userdata',formData1)
            if(response.status===201){
                setMessage("SuccessFully signup ! Please Login")
            }
         } catch (error) {
            
         }
   }
    const handleChange1 = (event) => {
        const { name, value } = event.target;
        setFormData1({
            ...formData1,
            [name]: value
        });
    };

    const handleClick = () => {
        setVisible(!visible);
    };

    return (
        <div className="container">
           <div className='welcome'>
           <h1>RIDE-RENTAL</h1>
           <h3>Weclcome Back !</h3>
           </div>
                {visible ? (
                    <form className="login-form">
                        <h2>Login</h2>
                        <div className="form-group">
                            <label>Email Id:</label>
                            <input 
                                type='emailid' 
                                placeholder='Enter Email Id'
                                name='emailid'
                                value={formData.email}
                                onChange={handleChange}
                            />
                        </div>
                        <div className="form-group">
                            <label>Password:</label>
                            <input 
                                type='password' 
                                placeholder='Enter Password'
                                name='password'
                                value={formData.password}
                                onChange={handleChange}
                            />
                        </div>
                        <div className="form-group">
                            <input type='submit' value='Login'/>
                        </div>
                        <p>New User? <button type="button" onClick={handleClick}>Sign Up</button></p>
                    </form>
                ) : (
                    <form className="signup-form" onSubmit={handleSubmit1}>
                        <h2>Sign Up</h2>
                        <div className="form-group">
                            <label>Full Name:</label>
                            <input 
                                type='text'
                                name='fullname'
                                value={formData1.fullname}
                                placeholder='Enter Full Name'
                                onChange={handleChange1}
                                required
                            />
                        </div>
                        <div className="form-group">
                            <label>Email Id:</label>
                            <input 
                                type='email'
                                name='email'
                                value={formData1.email}
                                placeholder='Enter Email Id'
                                onChange={handleChange1}
                                required
                            />
                        </div>
                        <div className="form-group">
                            <label>Contact No:</label>
                            <input 
                                type='tel'
                                name='mobno'
                                value={formData1.mobno}
                                placeholder='Enter Contact No'
                                onChange={handleChange1}
                                max={10}
                                required
                            />
                        </div>
                        <div className="form-group">
                            <label>Password:</label>
                            <input 
                                type='password'
                                name='password'
                                value={formData1.password}
                                placeholder='Enter Password'
                                onChange={handleChange1}
                                required
                            />
                        </div>
                        <div className="form-group">
                            <label>Confirm Password:</label>
                            <input 
                                type='password'
                                name='cpassword'
                                
                                placeholder='Confirm Password'
                               
                                required
                            />
                        </div>
                        <div className="form-group">
                            <input type='submit' value='Sign Up'/>
                            {message&&(
                                <div className='message'>
                                    {message}
                                </div>
                            )}
                        </div>
                        <p>Don't have an account? <button type="button" onClick={handleClick}>Login</button></p>
                    </form>
                )}
                
            
        </div>
    );
}
